window.bookSummaryJSON = "<p>Discover the love story that captured over 20 million hearts in&nbsp;<i>Me Before You</i>,&nbsp;<i>After You</i>, and&nbsp;<i>Still Me</i>.</p> <p>They had nothing in common until love gave them everything to lose...</p> <p>Louisa Clark is an ordinary girl living an exceedingly ordinary life - steady boyfriend, close family - who has never been farther afield than their tiny village. She takes a badly needed job working for ex-Master of the Universe Will Traynor, who is wheelchair bound after an accident. Will has always lived a huge life - big deals, extreme sports, worldwide travel - and now he’s pretty sure he cannot live the way he is.</p> <p>Will is acerbic, moody, bossy - but Lou refuses to treat him with kid gloves, and soon his happiness means more to her than she expected. When she learns that Will has shocking plans of his own, she sets out to show him that life is still worth living.</p> <p><i>A Love Story</i> for this generation, <i>Me Before You</i> brings to life two people who couldn’t have less in common - a heartbreakingly romantic novel that asks, What do you do when making the person you love happy also means breaking your own heart?</p> <p>Cast of Narrators:</p> <ul> <li>Susan Lyons</li> <li>Anna Bentink</li> <li>Steven Crossley</li> <li>Alex Tregear</li> <li>Andrew Wincott</li> <li>Owen Lindsay</li> </ul>"; 
